import React from "react";
import jtdHeader from "./JTDHeader.module.scss";

//import common components
import { ResourceLink } from "../../commonComponents/resourceLink";

//import header links
import { HEADER_LINKS } from "../../assets/HeaderLinks";

export const JTDHeader = () => {
  return (
    <div className={jtdHeader.nav_container}>
      <div className={jtdHeader.nav_logo}></div>
      <div className={jtdHeader.nav_links}>
        {HEADER_LINKS.map((item) => (
          <ResourceLink link={item} key={item.id} />
        ))}
        <div className={jtdHeader.nav-button}>
          <button>DONATE NOW</button>
        </div>
      </div>
    </div>
  );
};
